    return ('Â£' + Math.floor(params.value)
        .toString()
        .replace(/(\d)(?=(\d{3})+(?!\d))/g, '$1,'));
}



const GridExample = () => {
    const gridRef = useRef();
    const containerStyle = useMemo(() => ({ width: '100%', height: '100%' }), []);
    const gridStyle = useMemo(() => ({height: '100%', width: '100%'}), []);
    const [rowData, setRowData] = useState(getData());
    const [columnDefs, setColumnDefs] = useState([
    { field: 'category', rowGroupIndex: 1, hide: true },
    { field: 'price', aggFunc: 'sum', valueFormatter: poundFormatter },
    { field: 'zombies' },
    { field: 'style' },
    { field: 'clothes' },
]);
    const defaultColDef = useMemo(() => { return {
    flex: 1,
    width: 100,
} }, []);
    const autoGroupColumnDef = useMemo(() => { return {
    headerName: 'Group',
    minWidth: 250,
    field: 'model',
    rowGroupIndex: 1,
    cellRenderer: 'agGroupCellRenderer',
    cellRendererParams: {
        checkbox: true,
    },
} }, []);
    const getRowClass = useCallback((params) => {
    var rowNode = params.node;
    if (rowNode.group) {
        switch (rowNode.key) {
            case 'In Workshop':
                return 'category-in-workshop';
            case 'Sold':
                return 'category-sold';
            case 'For Sale':
                return 'category-for-sale';
            default:
                return undefined;
        }
    }
    else {
        // no extra classes for leaf rows
        return undefined;
    }
}, []);



